const Logo = () => {
  <a href="https://adalab.es/" target="_blank">
    <img
      title="Home Adalab"
      src="./images/adalab-logo-155x61.png"
      alt="Logo Adalab"
      class="logo"
    />
  </a>;
};
export default Logo;
